import { Link } from 'react-router-dom';

function NavigationBar(){
    return (
        <header>
            <nav>
                <ul>
                    <li>
                        <Link to='/groups'>Groups</Link>
                    </li>
                    <li>
                        <link to='/teachers'>Teachers</link>
                    </li>
                </ul>
            </nav>
        </header>
    )
}

export default NavigationBar;
